function dis(a, b) {

  var ax = a[0]

  var ay = a[1]

  var az = a[2]

  var bx = b[0]

  var by = b[1]

  var bz = b[2]

  var dx = ax - bx

  var dy = ay - by

  var dz = az - bz

  return Math.sqrt( dx * dx + dy * dy + dz * dz )

}

function alp(c, a) {

  return [c[0], c[1], c[2], a]

}

